import React from 'react';
import './Header.css';

function Header() {
  return (
    <div class="header">
      <div className="flex-container">
        <div className="flex-child">
          <img className="logo-img" src="/cctracker-logo.png" alt=""></img>
        </div>
        <div className="flex-child logo-txt">CCTracker</div>
      </div>
    </div>
  )
}

export default Header
